    false,nt"url": null,nt"notes": "This report provides an analysis of potential
    ecological effects on killdeer reproduction and viability at a nesting site in southern
    Nevada. Data were in the form of concentration of alpha-, beta-, gamma-, and delta-HCH
    (hexachlorocyclohexane, a.k.a., BHC for benzene hexachloride, or lindane) and DDx
    (DDT, DDE, DDD and their isomers) in killdeer eggs. The investigation was directed
    at finding summaries of known toxicological effects and toxicological benchmarks
    for avian wildlife for BHC and DDx.",nt"license_title": "License Not Specified",nt"extras":
